 renderVideoData() {
  const Shivam = this.state.response;

  return Shivam.map((student) => {
    let sr=student.video.originalUrl;
    let po=student.video.coverImageUrl;

    return (
      <div>
      <div style={{display:"flex",justifyContent:"center"}}>
      <video 
        onMouseOver={this.playMovie}
        onMouseOut={this.stopMovie}
        src={sr}
        poster={po}

        loop/>

    </div>
    <Button
        onClick={this.handleCollapse}

      >
        Show Information
      </Button>
      {this.state.visible &&   <Alert
              style={{ width: "90px", height: "40px", marginBottom: "20px" }}
              class="alert alert-success"

            >

                hhhh

            </Alert>
  }
    </div>
    );
  });
}
 stopMovie = (e) => {
  e.target.pause();
  console.log('off');
}

playMovie = (e) => {
  e.target.play();
  console.log('on');
}
handleCollapse=(e)=>{

if(this.state.visible===false){
  this.setState({visible:true})
}
if(this.state.visible===true){
  this.setState({visible:false})
}
e.preventDefault();
}

  render(){
     console.log(this.state.visible)
    return(
     <div>
      {this.renderVideoData()} 
      </div>

    )
  }
